import React from 'react'

function Container(props) {
    return (
        <main id="maincontent" class="container">
            <section class="row">
                <div class="col-md-12">
                    <h1>{props.containerLabel}</h1>
                </div>
            </section>
        </main>
    )
}

export default Container
